@Component({
  selector: 'app-banner',
  templateUrl: './banner.component.html',
  styleUrls: ['./banner.component.css']
})
export class BannerComponent {
  imgOne: String = 'assets/images/banner1.png';

 arrayImg : any[] = [
 { imgTwo:'assets/images/banner1.png'},
 { imgthird:'assets/images/banner1.png'}
 ]
}
<div>
<p>Trusted by Companies like</p>

<div>
    <div class="card-group">
        <div class="card">
          <img [src]= "imgOne" class="card-img-top" alt="...">
        </div>
        <div class="card">
          <img src={{arrayImg.imgTwo}} class="card-img-top" alt="...">
          </div>

